import React from 'react'

const AddTaskListForm = () => {

  const formSubmit = e =>{
    e.preventDefault();
  }
  return(
    <div>
      <form>

      <label>AddTaskListForm</label>
      <input></input>
      <button type="submit" onClick={formSubmit}>Add</button>
    </form>
    </div>
  )
}


export default AddTaskListForm;
